var BuyCar=new Vue({el:"#app",data:{active:!0,carImage:"img/car-image.png",carName:"ELEGY FT",carNumber:"MI33KE",carLogoImg:"img/car-logo.png",carProps:[4,3,4,4],carTechs:[5,3,2,2,2],player:"MIKE ROBOX",price:"350 000"},methods:{setinfo(e){this.carName=e[0],this.carNumber=e[1],this.carLogoImg=e[2],this.carProps=e[3],this.carTechs=e[4],this.player=e[5],this.price=addSpaces(e[6])},replaceImg(){this.imgupload&&(this.familyurl="images/hype.png")},btnAccept(){},closeMenu(){this.active=!1}}});function addSpaces(e){let a,r,c=0,i=0,s=[];for(a=String(e).split("").reverse(),console.log(a);c<a.length;)r=(c+1)%3,s[i]=a[c],0!==r?(c++,i++):(s[++i]=" ",c++,i++);return s.reverse().join("")}